        public GirlNamesCatalog()
        {
            list = new List<NameEntity>
            {
                new NameEntity {Value = "Adela", NameDay = "22. december", Description = "Ženské meno Adela má francúzsky pôvod a v preklade znamená \"ušľachtilá bytosť, vznešená\". Spája v sebe osobný šarm s vynaliezavosťou a výrečnosťou. Vie aj riskovať a konať bez dlhých rečí. Ak miluje, potom je úprimná a otvorená. Ak intriguje a ohovára, potom je to klebetnica. Mení svoju osobnosť podľa potreby a málokto vie o nej povedať ucelený názor. Život s ňou je ako keby ste žili vedľa sopky, ktorá môže kedykoľvek vybuchnúť. Preto je dôležité vždy si zachovať chladnú hlavu a nebrať ju príliš vážne, ak vám vyčíta niečo zlé, alebo vás obviňuje. Často koná v afekte a potom ju to všetko, čo povedala, mrzí. Ovplyvňuje ju planéta Venuša. Jej ochranné kamene sú smaragd, zafír a karneol."},
                new NameEntity {Value = "Adriána", NameDay = "26. jún", Description = "Ženské meno Adriána má latinský pôvod a jeho význam je \"prichádzajúca od mora\". Osobným číslom tohto mena je 1 – Vodca. Ich obľúbené farby sú tmavozelená, žltá a modrá, ochranné rastliny myší chvost a fialka, ochranné kamene achát a opál. Tieto ženy pôsobia veľmi očarujúco a pôvabne. Adriány nie sú zlomyselné, aj keď niekedy je ťažké vedieť im rozumieť. Ich život je veľmi pohotový a energický. Majú svoje pravidlá, podľa ktorých sa riadia vo svojom živote a hlavne veria na spravidlivosť v ich okolí. Ak nastane nejaká nečakaná situácia, rýchlo sa zmenia a dokážu sa správať proti svojim zásadam. Adriány by sa mali vyhýbať hlavne vypočítavosti a pomstychtivosti. Ak budú žiť podľa svojich predstáv, budú veľmi úspešne a vyhnú sa prekážkam a zlým okolnostiam. Na druhej strane, ak ich niekto niekto ovplyvní, nebudú Adriany vo svojej koži a nebudeme môcť predvídať ako zareagujú. Toto meno je vhodné pre znamenia Baran, Lev, Panna, Strelec, Blíženci."},
                new NameEntity {Value = "Agáta", NameDay = "5. február", Description = "Ženské meno Agáta má grécky pôvod a v preklade znamená \"láskavá, dobrá\". Osobným číslom tohto mena je 5 – Riziko. Obľúbené farby týchto žien sú žltá, strieborná, zelená, biela a modrá. Ich zvieracím totemom je jašterica, ochranné rastliny sú rumanček, konvalinka a fialka. Ochranné kamene nefrit, perla a rubín. Agáta je typ ženy, ktorá je väčšinou nepokojná, podráždená a nestála. Napriek tomu, sa vždy snaží, aby ľudia v jej okolí boli spokojní a uvoľnení, nedokáže odmietnuť od niekoho prosbu. Netreba ju hnať do niečoho, požaduje viac času na to, aby sa dokázala prispôsobiť iným okolnostiam a očakávaniam. Nedávajú najavo, že ich niečo trápi a preto ťažko získavajú nejakých priateľov. Tak je to aj u Agátinych partnerov. Lásku často odmietajú a partnerov do života si hľadajú dlhý čas. V svojej rodine žijú spokojne, aj keď sa pri deťoch nedokážu uvoľniť, v starostlivosti o ne sú pedantné a svojich potomkov nenechávajú len tak bez dozoru ani na okamžik, čo sa im vždy nemusí podariť. Agáty potrebujú pokoj, lebo kvôli svojej nestálosti a úzkosti zo života majú často problémy so zdravím. Rýchlo sa dokážu vyčerpať a preto by sa mali vyhýbať preťažovaniu a únave. Obozretne by mali byť v jedení cukru, cestovín a bieleho chleba, majú totiž tendenciu rýchlo nabrať váhu. Zameriavajú sa na štúdium dejín a majú úspech aj v oblasti módy. Pre Agáty je vhodné znamenie Strelec, Vodnár, Lev a Váhy."},
                new NameEntity {Value = "Agnesa", NameDay = "16. november", Description = "Meno Agnesa je gréckeho pôvodu a v preklade znamená \"čistá\", \"nevinná\". Vedie aktívny život, plný vzruchov a zmien. Nikdy nebude pokojne žiť, vždy bude mať niečo rozrobené, naplánované a ešte nedosiahnuté. Nemala by sa skoro viazať na rodinu a manžela, či deti. V prvom rade by mala zvážiť, či dokáže zladiť všetky svoje záujmy, či by nebolo lepšie postupovať krok za krokom a nesnívať o tom, že bude mať všetko naraz. Ak ju v mladosti nejako prezývali, mala by v dospelosti používať len kalendárnu formu svojho mena, lebo sa tak vyhne konfliktom a problémom Ovplyvňuje ju planéta Venuša. Jej ochranné kamene sú achát a zafír."},
                new NameEntity {Value = "Alana", NameDay = "8. marec", Description="Krstné meno Alana má keltský pôvod a význam mena v preklade je \"súlad, svornosť\". Alany ovplyvňuje planéta Venuša. Ich obľúbené farby sú žltá a fľaškovozelená, ochranné rastliny myší chvost a šafran, ochranný kameň opál. Nemali by sa hnevať na iných za svoje vlastné chyby. Osobným číslom pre toto meno je 2 - Dobrota Nositeľky tohto mena bývajú občas flegmatické, ale ak sa naskytne nejaký problém, vždy ho rýchlo vyriešia. Aj keď Alany pôsobia veľmi silne, ich psychická vyrovnanosť nie je stabilná. Všetko berie veľmi vážne a nedokáže sa uvoľniť. Ľudia okolo nich ich radi zneužívajú kvôli tomu, že nevedia povedať „nie“. Často sa v druhých sklamú a potom trpia. Aby boli tieto ženy šťastné a našli tých správnych ľudí, ktorí im pomôžu, mali by byť narodené v znameniach Panny, Rýb, Strelca a Blíženca."},
                new NameEntity {Value = "Albína", NameDay = "16. december", Description = "Ženské meno Albína má latinský pôvod a v preklade znamená \"biela\". Je často považovaná za zvláštnu a záhadnú ženu. Takmer nikto si nedá tú námahu, aby pochopil jej správanie a činy. Sama niekedy nevie vysvetliť svoj postup a aj jej plány do budúcnosti sú dosť zahmlené. Má problém určiť, čo vlastne presne chce a čo od koho očakáva. Kým si nevyjasní svoje vlastné ciele, tak sa jej bude žiť ťažko a nenájde si dobrých priateľov. Až keď nájde samú seba, potom dokáže hľadať vhodných ľudí, ktorí jej pomôžu a podporia ju. Ani do manželstva, alebo priateľstva by sa nemala hnať bezhlavo, či bez premýšľania, inak sa môže často pomýliť. Ovplyvňujú ju planéty Saturn a Urán. Jej ochranné kamene sú ametyst, achát a perla."},
                new NameEntity {Value = "Alena", NameDay = "27. marec", Description = "Ženské meno Alena je variantom gréckeho mena Helena, ktoré znamená \"svetlo\" alebo skrátenou podobou novozákonného mena Magdaléna, ktorého význam je \"pochádzajúca z palestínskeho mesta Magdaly\". Aleny ovplyvňuje planéta Mars. Ich šťastné farby sú červená a zelená, ochranné rastliny céder a orgován, ochranné kamene diamant a ametyst. Osobným číslom tohto mena je 9 – Génius. Nositeľky tohto meno sú stále a elegantné ženy. Nemajú problém vyriešiť si nejaké ťažkosti. Aleny sa vždy snažia aby pôsobili milo a získali si ostatných na svoju stranu. Sú to spoločenské ženy, ktoré vedia sa správať pôvabne a to im pomáha získať úspech. Vedia byť pokojné a tolerantné, ale ak ich niekto sklame, stratí u nich úplnú dôveru. Tieto ženy sú veľmi talentované, ale veľakrát sa stáva, že sú lenivé. Musia mať pri sebe niekoho blízkeho, kto im bude pomáhať a podporovať ich. Toto meno je vhodné pre znamenia : Váhy, Lev, Panna, Baran. Vhodnou farbou je zelená a žltá."},
                new NameEntity {Value = "Alexandra", NameDay = "2. január", Description = "Ženské meno Alexandra pochádza z gréčtiny a znamená \"ochrankyňa mužov\".Jej osobným číslom je 8 – Peniaze. Ich obľúbená farba je tmavomodrá a oranžová, ochranná rastlina puškvorec a ochranný kameň rubín. Nositeľky mena Alexandra sú veľmi zvedavé a majú veselú povahu. Na Alexandry si treba však dávať pozor. Vedia totiž dlhší dlhý čas skrývať svoju vlastnú tvár a hrať sa na niekoho iného, len aby dosiahli svoj cieľ. Dokážu sa presadiť v akomkoľvek prostredí, majú veľkú prispôsobivú schopnosť. V láske sú Aleaxandry veľmi otvorené, úprimné a snažia sa splniť svojmu vyvolenému všetky priania. No vždy za svoju ochotu niečo chcú a ak nedostanú adekvátnu odmenu, potom sa vedia kruto pomstiť a zničiť toho, kto ich oklamal. Disponujú priam neuveriteľnou pamäťou. Vždy všetko vedia a ak aj nie, tak sa snažia do danej problematiky preniknúť. Rady sa učia a štúdium im nerobí problémy. V profesii, ktorú si zvolia, sú precízne a cieľavedomé. Je to meno vhodné pre akékoľvek znamenie."},
                new NameEntity {Value = "Alica", NameDay="6. september", Description = "Ženské meno Alica má nejasný pôvod. Je pravdepodobne odvodené zo staronemeckého mena Adelheid, čo v preklade znamená \"vznešená bytosť\". Málokto sa vyzná v jej duši a málokto vie odhaliť jej pravú tvár. Pohybuje sa rada v dobrej spoločnosti a od života vyžaduje maximum. Vie sa starať o svojich priateľov a ničiť svojich nepriateľov. Jej veľkou túžbou je usporiadať si svoj život tak, aby bol pokojný a bez výkyvov, ale nie vždy sa jej to podarí. S veľkou radosťou si sama podpíli konár, na ktorom sedí a potom sa díva na trosky svojho života. Má rada lásku a sex, nič jej nezabráni, ak sa rozhodne pre neveru. Ako matka je však príkladná a nikdy svoje deti neopustí, ani im úmyslene neublíži. Ochranné kamene sú akvamarín a smaragd."},
                new NameEntity {Value = "Alojzia", NameDay = "23. október", Description = "Ženské meno Alojzia je staronemeckého pôvodu a znamená \"celá biela\". Je spoločenská, plná optimizmu a životaschopnosti. Nikdy sa necíti slabo, alebo v depresii. Vie si nájsť aj v tom najhoršom niečo dobré. Túži po láske a aj ju dostáva. Málokedy si vyberie zle a tak sa vyhýba sklamaniam. Je zodpovedná a nikto nemôže pochybovať o jej dôveryhodnosti. Očakáva od osudu a okolia len dobré a naozaj sa k nej všetci snažia správať milo a ústretovo. Nemá veľkú výdrž a keď narazí na kopec prekážok, radšej sa mu vyhne, odstúpi a povie to na rovinu. Je až priveľmi otvorená a jej slová dokážu raniť. Je dobrou matkou a manželkou, no niekedy sa dá zlákať aj na cestu hriechu. Aj keď je spokojná, rada riskuje. Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú jaspis a nefrit."},
                new NameEntity {Value = "Alžbeta", NameDay = "19. november", Description = "Ženské meno Alžbeta má hebrejský pôvod, je novozákonné a v preklade znamená \"Bohu zasvätená\". Je to silná osobnosť, ktorá dokáže viesť iných a vládnuť slabším, no spravodlivo a bez osobného prospechu. Môže dosiahnuť vysoký post, nezáleží, v akom smere sa chystá uplatniť. Má osudom dané schopnosti, ktoré ju uprednostňujú a posilňujú, takže všetko zvládne. Dokáže uspieť aj vo výnimočnej konkurencii. Je úprimná a oddaná, miluje nadovšetko svoju rodinu a pre svojich blízkych dokáže urobiť všetko. Energia a dobrá nálada jej pomáha nájsť si priateľov v každej oblasti a ľudia jej radi pomáhajú Ovplyvňujú ju planéty Saturn a Urán. Jej ochranné kamene sú sokolie oko a perla."},
                new NameEntity {Value = "Amália", NameDay = "10. júl", Description = "Ženské meno Amália má germánsky pôvod a význam mena je \"pracovitá\". Osobným číslom je 4 – Sila. Šťastné farby sú tmavomodrá a červená. Ochranné rastliny sú puškvorec a bazalka, ochranné Kamene rubín, diamant a achát. Tieto ženy sú veľmi zvedavé a spoločenské. V neznámom prostredí a prítomnosti neznámych ľudí sa necítia nepríjemne. Veria, že treba využiť každú príležitosť, ktorá sa im v živote naskytne. Takto si rozširujú svoje vedomosti a schopnosti. Amálie sú silné osobnosti a snažia sa byť, čo najviac dokonalé. Veľmi dbajú o svoj zovňajšok, a preto pôsobia upravene. V ich prítomnosti sa ľudia cítia nepríjemne, pretože majú pocit, že sa nad nimi povyšuje aj keď to tak nie. Preto má aj málo skutočných priateľov. Ak potrebujú Amálie oddychovať, stiahnu sa a v pokoji premýšľajú, pretože chcú mať na všetko svoj vlastný názor. V oblasti zdravia nie sú veľmi odolné. Neprospieva im časté ponocovanie. Toto meno je vhodné pre znamenia: Baran, Škorpión, Vodnár, Býk a Kozorožec."},
                new NameEntity {Value = "Anabela", NameDay = "20. august", Description = "Ženské meno Anabela vzniklo spojením mien Anna a Bella, alebo spojením Anna a Sibyla, alebo z latinského mena Amabel, čo v preklade znamená \"hodná lásky\", \"milá\", \"ľúbezná\". Ovplyvňujú ich planéty Mars a Pluto. Ich šťastné farby sú tmavomodrá, žltá a červená. Ochranné rastliny puškvorec, bazalka, ochranné kamene rubín, diamant a achát. Ich osobným číslom je 4 – Sila. Tieto ženy musia byť vždy obklopené ľuďmi. Potrebujú, aby ich niekto uznával a aby mohliľ Anabely im rozkazovať. Niektoré nositeľky tohto mena bývajú ostýchavé a nevedia sa pred ostatnými uvolniť. Sú vďačné za každú pomoc a starostlivosť, ktorú im venujú ich blízky. Aj keď sa vedia prebojovať, majú strach riskovať. Ak budú mať pri sebe nejakú oporu, dostanú sa ďaleko a budú úspešné. Keďže si vedia poradiť v každej situácií, často sa zamestnávajú ako vedecké pracovníčky alebo poslankyne. Anabely majú zdravie striedavé, aj keď pôsobia celkom zdravo. Mali by si dávať pozor na svoje slabé kosti a citlivý žalúdok. Toto meno je vhodné pre znamenia : Ryby, Váhy, Panna, Strelec a Lev."},
                new NameEntity {Value = "Anastázia", NameDay = "30. apríl", Description = "Meno Anastázia má grécky pôvod a jeho význam je \"vzkriesená\". Osobným číslom tohto mena je 4 - Sila. Anastázie si nevedia nájsť svoje miesto. Niekedy sú plné života a niekedy spadajú do depresii. Sú to charakteristické osoby, ktoré pútajú na seba pozornosť aj v spoločnosti. Tieto ženy sú introvertky, ktoré sú úprimné k ľuďom, aj keď nerady hovoria niekomu negatívne veci. Anastázie vyžadujú, aby okolo nich bol pokoj a porozumenie. Svojej profesii sa veľmi nevenujú a často menia svoje záľuby. Ak sa obrátite na Anastázie, môžete čakať úspech. Ich vitalita je skvelá, ale napriek tomu môžu podliehať nadváhe. Mali by jesť veľa hrozna, jabĺk a mrkvy. Potrebujú tiež veľa spánku. Toto meno je vhodné pre znamenia : Váhy, Strelec, Ryby a Baran. Ich obľúbené farby sú fľaškovozelená a biela, ochranné rastliny myší chvost, fialka a mäta, ochranné kamene achát, zafír a koral."},
                new NameEntity {Value = "Andrea", NameDay = "5. január", Description = "Ženské meno Andrea má grécky pôvod a preložiť sa dá ako \"odvážna\". Osobným číslom tohto mena je 5 – Riziko. Obľúbená farba týchto žien je červená, modrá a biela, ochranným kameňom je achát Andrey sú zaujímavé a dobrodružné povahy. Nikdy nikto presne nevie, o čo im ide a ako to chcú dosiahnuť. Ale majú dostatok síl a aj schopností. Sú nadané získať pre seba a svojich blízkych potrebné množstvo prostriedkov, aby sa mali dobre. Bývajú niekedy skúpe a v mladosti sú často klamané a zneužívané. Len čo sa dozvedia, že ich niekto zradil, podviedol, alebo im bol neverný, konajú okamžite a dokážu sa spamätať veľmi rýchlo. Nepotrebujú žiadny súcit, ani ľútosť, ale majú pevné nervy a reálny pohľad na svet, no vždy sa snažia hľadať v iných len to dobré, a za to občas zaplatia. Prežiť sklamanie teda zvládnu. Toto meno je šťastné a svojej majiteľke prinesie postup vpred, úspech a aj uznanie v akomkoľvek smere, ktorý si zvolí. Tieto ženy si rozumejú s ľuďmi zo znamení Blížencov, Kozorožca, Panny, Raka a Leva."},
                new NameEntity {Value = "Anežka", NameDay = "2. marec", Description = "Ženské meno Anežka má grécky pôvod a význam mena je \"čistá, nevinná\". Ich šťastné farby sú biela, zelená a bledomodrá. Ochranné rastliny kostihoj a modrý hyacint, ochranné kamene zafír a koral. Nemali by reagovať podráždene a nepodliehať tvrdohlavosti. Jej osobné číslo je 7 - Tajomnosť. Tieto ženy potrebujú pokoj, ale nikdy ho nemôžu nájsť. Anežky sú milé ženy, ktoré veľmi nehovoria o svojich plánoch a myšlienkach. Majú rady, keď o nich vedia v spoločnosti. Tieto ženy sú starostlivé a vždy sa snažia iným pomáhať a povzbudzovať. Sú to osobnosti, ktoré sú plné vtipu. Vo svojom živote ale aj v zamestnaní sú nestále. Pôsobia náladovo a nepokojne. Sú prispôsobivé, ale nevedia si nájsť svoj správny smer a ciele. Ak si ujasnia svoje zámery a plány, budú mať úspech a pokoj v živote. Toto meno je vhodné pre znamenia : Váhy, Blíženci, Strelec, Lev."},
                new NameEntity {Value = "Angela", NameDay = "11. marec", Description = "Ženské meno Angela má latinský pôvod a jeho význam je \"anjelská\". Ovplyvňuje ich planéta Mars. Obľúbená farba týchto žien je fialová, ochranné rastliny majú konvalinku a puškvorec, ochranný kameň rubín. Osobným číslom pre toto meno je 3 - Schopnosť. Aj keď tieto ženy pôsobia ako jemné a nežné ženy, dokážu výborne odolávať a bojovať proti ťažkostiam. Ak využijú všetky svoje nadania, tak budú v živote úspešné. V práci im ale chýba zodpovednosť. Mali by byť viac vytrvalé a venovať sa jednej záležitosti. Angely veľakrát menia svoje nálady a sú vzťahovačné. Nevedia sa prispôsobiť iným a preto ich veľa ľudí odmieta. Ony nakoniec zostanú samé, čo ich veľmi trápi. Často potrebujú od druhých pomoc a podporu, aby zvládli svoje záležitosti. Vitalita týchto žien je nestála. Zdravotný problémom sa vyhnú, ak budú mať dostatočný spánok a pohyb. Toto meno je vhodné pre znamenia : Rak, Panna, Váhy, Škorpión."},
                new NameEntity {Value = "Angelika", NameDay = "11. marec", Description = "Ženské meno Angelika má latinský pôvod a jeho význam je \"anjelská\". Ovplyvňuje ich planéta Mars. Obľúbená farba týchto žien je fialová, hnedá a modrá. Ochranné rastliny majú konvalinku a puškvorec, ochranný kameň rubín. Angelika je meno s osobným číslom 4 - Sila. Ženy s týmto menom majú romantickú povahu, ale nie sú až priveľmi citlivé. Angeliky sú starostlivé ženy, ktoré by potrebovali častejšie oddychovať. Od druhých nepotrebujú nijakú pomoc pri zabezpečení ich budúcnosti, ony sa vedia samé o seba postarať. Sú to silné ženy, ktoré vedia prekonávať svoje problémy. Ak nebudú mať pri sebe zodpovedných ľudí, stanú sa z nich panovačné a neuspokojené ženy. Toto meno je vhodné pre znamenia : Strelec, Kozorožec, Vodnár, rak, Býk a vhodnými farbami sú svetlomodrá, fialová a hnedá."},
                new NameEntity {Value = "Anna", NameDay = "26. júl", Description = "Ženské meno Anna má hebrejský pôvod a jej význam je \"milá\", \"milostná\". Osobným číslom je 4 – Sila. Ovplyvňujú ich planéta Mars a Pluto. Šťastné farby sú tmavomodrá, červená a ružová. Ochranné rastliny palina dračia, puškvorec, bazalka, kamene rubín, diamant, opál a topás. Tieto ženy sú hrdé, intuitívne, dynamické a majú pevnú vôľu. Svoju dobrú pamäť využívajú len vtedy, keď sa im to hodí. Dokážu byť panovačné a dosť prefíkané, no nikdy nie sú zúfalé. Ale vedia poriadne trucovať a zlostiť sa, keď sa im niekto nepoddá. Málokedy dokážu povedať, čo si v skutočnosti myslia. No málo sa dajú ovplyvniť. Neúspech ich ľahko nepoloží. Ženy s týmto menom sú veľmi zvedavé. Najviac milujú samých seba a chcú sa dostať do popredia za každú cenu. Anny nemajú veľmi pevné zdravie. Neprospievajú im tvrdé diéty a časté ponocovanie. Toto meno je vhodné pre znamenia Panna, Váhy, Baran a Býk"},
                new NameEntity {Value = "Antónia", NameDay = "6. január", Description = "Ženské meno Antónia má latinský pôvod a v preklade vyjadruje \"popredná\", \"vynikajúca\". Osobným číslom tohto mena je číslo 2 a tým je Dobrota. Ich obľúbená farba je červená, ochranná rastlina rumanček a ochranný kameň rubín. Antónie nikdy nikomu úmyselne neublížia, vždy súcitia s inými a snažia sa pomáhať im. Nič nežiadajú za svoju pomoc, ale napriek tomu vždy dostanú to, po čom túžia. Sú narodené pod šťastnou hviezdou. Keď dáme dieťaťu takéto meno, akoby sme mu dali dar, alebo významnú pomôcku, ktorá sa mu v živote veľmi zíde. Toto meno je skvelé a má vynikajúcu pozitívnu vibráciu. Antónie sú odmeňované za všetko dobré hneď, nemusia čakať. Keď niekomu podajú pomocnú ruku, následne sa im podarí dosiahnuť niečo osobné, čo ich robí spokojnými. Meno Antónia je vhodné pre znamenia Býka, Kozorožca, Škorpióna a Vodnára."},
                new NameEntity {Value = "Aurélia", NameDay = "31. október", Description = "Ženské meno Aurélia má latinský pôvod a v preklade znamená \"zlatá\". Má stále otvorené uši a oči. Snaží sa získať všetky možné dostupné informácie a hľadá pre seba tú najschodnejšiu cestu. Neplýtva dobrotou na hocičo a hocikoho. Radšej riadi a využíva dobrotu iných, samozrejme diplomaticky a nenápadne. Jej okolie ani netuší, že je využívané. Vie sa votrieť každému do priazne, využije aj drobnosti, len aby dosiahla svoj cieľ. No vždy sa vyhýba klebetám, či intrigovaniu. Ak jej pomoc odmietneme, nehnevá sa, len nás zaradí do inej kategórie, medzi ľudí, na ktorých musí použiť inú taktiku. Ovplyvňujú ju planéty Saturn a Urán. Jej ochranné kamene sú ametyst a achát."},
                new NameEntity {Value = "Barbara", NameDay = "4. december", Description = "Ženské meno Barbara, tak ako Barbora má grécky pôvod a v preklade znamená \"cudzinka\". Má v sebe výraznú ženskosť s veľmi mužským nazeraním na svet. Ľahko sa prispôsobí a využíva iných, ale vždy sa to snaží zakryť jemným vystupovaním a šarmantným správaním. Je nebezpečná a presadí sa aj v tom najnevhodnejšom prostredí. V láske a citoch je kolísavá, prelietavá a málokedy sa vie zamilovať celkom bez kontroly. Jej povaha vyžaduje boj, zmeny, náhle udalosti, musí mať adrenalín na určitej úrovni, aby povedala, že má za sebou dobrý deň. Preto je život s ňou nádherný, vždy plný udalostí a úplne bez nudy. Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú achát, citrín a tigrie oko."},
                new NameEntity {Value = "Barbora", NameDay = "4. december", Description = "Ženské meno Barbora, tak ako Barbara má grécky pôvod a v preklade znamená \"cudzinka\". Má v sebe výraznú ženskosť s veľmi mužským nazeraním na svet. Ľahko sa prispôsobí a využíva iných, ale vždy sa to snaží zakryť jemným vystupovaním a šarmantným správaním. Je nebezpečná a presadí sa aj v tom najnevhodnejšom prostredí. V láske a citoch je kolísavá, prelietavá a málokedy sa vie zamilovať celkom bez kontroly. Jej povaha vyžaduje boj, zmeny, náhle udalosti, musí mať adrenalín na určitej úrovni, aby povedala, že má za sebou dobrý deň. Preto je život s ňou nádherný, vždy plný udalostí a úplne bez nudy. Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú achát, citrín a tigrie oko."},
                new NameEntity {Value = "Beáta", NameDay = "28. jún", Description = "Ženské meno Beáta má latinský pôvod a význam mena je \"blažená, šťastná\". Beáta má osobné číslo 4 - Sila. Ich obľúbené farby sú oranžová, červená a zelená, ochranné rastliny čakanka a saturejka, ochranné kamene jaspis a nefrit. Beáty pôsobia ako jemné a nevinné ženy, ale niekedy dokážu veľmi prekvapiť svojimi činmi. Svoje názory a city nedávajú najavo, radšej si skôr urobia v nich poriadok, kým niekomu o tom povedia. Tieto ženy rady ovplyňujú druhých, aby si ich získali na svoju stranu. Nebudú to robiť priamočiaro, ale až keď budú presvedčené o určitej skutočnosti. Sú to silné osobnosti, ale svoju silu nezneužívajú. Vedia dobre pomôcť pri riešení nejakých problémov alebo nedorozumení. Všetko, po čom Beáty túžia nakoniec aj získajú, aj keby mala za to zaplatiť. Bývajú spravodlivými sudkyňami, ktoré si vypočujú obe stránky a priklonia sa k tej, ktorá má pravdu. Málokedy bývajú šťastné, lebo stále očakávajú hrozbu, podvedome predvídajú útok z rôznych strán. Toto meno je vhodné pre znamenia Rýb, Váh, Panny a Kozorožca."},
                new NameEntity {Value = "Berta", NameDay = "2. júl", Description = "Ženské meno Berta má nemecký pôvod a jeho význam je \"slávna\", \"skvelá\". Osobným číslom tohto mena je 9 - Génius. Ovplyvňujú ich planéty Saturn a Urán. Ich šťastné farby sú čierna, fialová a tmavomodrá. Ochranné rastliny medovka, baza, ochranné kamene achát a perla. Tieto ženy si idú vždy za svojím cieľom, ktorý sa snažia vždy dosiahnuť, i keď niekedy náročnejšou cestou. Svoje predsavzatia robí naplno a až dokonca. Berty vedia vždy sa vynájsť v rôznych okolnostiach a vyriešiť problémy. Aj v tých najhorších obdobiach sa budú vedieť obracať v živote a postarať sa o seba. Čo sa týka ich zamestnania, dobre sa s Bertami pracuje. Ich silnou stránkou je výborná pamäť. Vie ostatných okolo seba naplno motivovať a viesť ich k úspechu. Svojich priateľov si vážia, nikdy ich nezradia, ale ak ich niekto oklame, pomstí sa. Ako silné ženy sú veľmi odolné. Ich životaschopnosť je v celku dobrá, iba ťažko odolávajú chorobám psychického pôvodu a a problémom so žalúdkom. K strave by si mali doplniť jedlá s vitamínmi C, E a vápnikom. Toto meno je vhodné pre znamenia : Panna, býk, Kozorožec, Ryby, Býk."},
                new NameEntity {Value = "Bianka", NameDay = "16. jún", Description = "Bianka je germánskeho pôvodu a má spoločné korene vzniku ako meno Blanka. Bianka je pôvodom \"Talianka\" a významovo je blízkou príbuznou Blanky. Obľúbenými farbami Bianky sú zelená a bledomodrá. Medzi ochranné rastliny patrí levanduľa a rasca, ochranné kamene achát a sardónyx. Tieto ženy sú veľmi citlivé, čo môžu využiť aj vo svoj prospech. Bianky sú temperamentné. Ich ženskosť je očividná v ich každodenných činoch. K im podstatným charakteristikám patrí koketnosť a majú rady ak ich niekto zvádza. Bianky sú skôr uzavretejšie, rady žijú komfortne a rady sú obklopované komplimentmi mužov a ich pozornosťou. Ich veľkou záľubou je cestovanie a spoznávanie nových krajín. Bianky by si mali dávať pozor na svoje zdravie a životaschopnosť. Toto meno je vhodné pre znamenie Vodnára, Strelca, Panny a Raka."},
                new NameEntity {Value = "Bibiána", NameDay = "2. december", Description = "Ženské meno Bibiána má latinský pôvod a v preklade znamená \"plná života\". Je priveľmi nežná, jemná a citlivá. Ak vyrastá v nevyrovnanej rodine, tak sa z nej nestane výrazná osobnosť. Je všade obľúbená pre svoju ochotu pomôcť a poradiť. Vie byť dobrou \"bútľavou vŕbou\", ale dlho potrvá, kým si nájde toho správneho. Tak málo si dôveruje, že radšej preberie priateľa svojej kamarátke, pretože podľa nej práve ona má dobrý vkus a jej chlapec je určite vhodný aj pre ňu. Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú jaspis a nefrit."},
                new NameEntity {Value = "Blanka", NameDay = "16. jún", Description = "Blanka je germánskeho pôvodu a má spoločné korene vzniku s menom Bianka. Blanka k nám prišla z ohnivého Španielska a značí \"bielu farbu\", ktorá je symbolom čistoty. Osobným číslom tohto mena je 9 - Génius. Obľúbené farby týchto žien sú zelená, oranžová a bledomodrá. Ochranné rastliny levanduľa a rasca, ochranné kamene achát a sardónyx. Toto meno je plné intenzity a energie, ale Bianky málokedy vedia využiť úplne túto silu, ktorú prináša meno. Aj keď sú tieto ženy citlivé, rady manipulujú ľudí, sú tvrdohlavé a chvíľkami namyslené. Ak sa stretnú Bianky s rovnakými silnými osobami, radšej ustúpia, stanú sa citlivými a ustúpčivými ženami. V práci sú usilovné a vedia rýchlo jednať a hlavne riskovať. Nemajú rady, ak by mali za svoje chyby platiť, preto sa radšej vyhovoria na druhých, len aby nemuseli stratiť čo získali, aj keď neprávom. Toto meno je vhodné pre znamenie Vodnára, Strelca, Panny a Raka."},
                new NameEntity {Value = "Blažena", NameDay = "11. máj", Description = "Ženské meno Blažena je slovanský variant mena Beáta, ktoré je latinského pôvodu a znamená \"blažená\". Osobným číslom tohto mena je 9 – Génius. Ich obľúbené farby sú sivá, biela, modrá, zelená a pomarančová. Ochranné rastliny palina, čakanka, ochranné kamene nefrit, sadrónyx a jaspis. Tieto ženy majú ťažkú povahu. Málokto sa v nich vyzná. Vždy sa usilujú, aby boli všetky veci okolo nich v poriadku. Sú to veľmi rozhodné a neústupčivé ženy. Blaženy majú introvertný typ povahy. Sú uzavreté a o svojich citoch a úsudkoch veľa nehovoria. Občas pôsobia klebetne, ale zdanie klame. Keďže súcitia s druhými, snažia, aby vedeli komu a kedy pomôcť v ťažkých situáciach. Ak budú dostatočne motivované, budú úspešne a dosiahnu zaslúžené finančné ohodnotenie. Blaženy bývajú bezohľadné voči ľuďom, ktorí sa snažia ich využiť. V zdraví by si mali dávať pozor na zdravotné problémy s pokožkou a pľúcami. Toto meno je vhodné pre znamenia Panna, Vodnár, Váhy, Strelec."},
                new NameEntity {Value = "Bohdana", NameDay = "18. január", Description = "Ženské meno Bohdana má slovanský pôvod a znamená \"dar Boží\", \"Bohom daná\". Osobným číslom tohto mena je 7 – Tajomnosť. Obľúbené farby týchto žien sú tmavomodrá, oranžová, a červená, ochranná rastlina puškvorec, ochranné kamene rubín, diamant a achát. Tieto ženy sú rady tam, kde je dobrodružstvo. Bohdany sú ambiciózne ženy a vždy vedia, čo chcú od života. Toto meno nesie veľa sily, ale Bohdany majú problém využiť túto energiu naplno. Bývajú občas arogantné a panovačné. Sú to úspešné ženy a rýchlo jednajú, ale ak spravia chybu, budú sa vyhovárať na ostatných, len aby nemuseli znášať riziko za svoje činy. Bohdany majú rozvážnu povahu, preto by sme nemali kritizovať ich extravagantné správanie. V kariére majú väčšinou šťastie, vďaka ktorému majú dobré výsledky. Vyhovuje im dlhodobé štúdium. Bohdany sa nakoniec nájdu v povolaní lekárky. Majú dostatočne veľké pracovné nadšenie a tiež ich láka nebezpečná profesia. Vitalita týchto žien je nestála. Ich zdravie je niekedy náchylne na malé nevoľnosti. Toto meno je vhodné pre znamenie Vodnára, Strelca, Panny a Raka."},
                new NameEntity {Value = "Bohumila", NameDay = "3. marec", Description = "Krstné meno Bohumila má slovanský pôvod a ich význam je \"milý bohu, milá bohu\". Bohumiline šťastné farby sú fialová, hnedá a červená. Ochranné rastliny púpava a orgován, ochranné kamene diamant a ametyst. Jej osobným číslom je 3 - Schopnosť. Aj keď nositeľky tohto mena bývajú občas introvertné, sú plné sily a energie. Sú to objektívne a starostlivé ženy. Bohumily sú silné ženy, ktoré urobia všetko, čo je v ich silách. Nikdy ich nič neodradí, pre ne neexistujú prekážky. Vždy budú dokazovať, že svoje ťažkosti vedia bez problémov zdolať. Ale ich nálady môžu byť striedavé. Ak sa im darí, je všetko v poriadku, ale naopak, ak niečo nezvládajú, sú oslabené. Ich najväčšou slabosťou sú city. Toto meno je vhodné pre znamenia : Rak, Panna, Kozorožec, Škorpión."},
                new NameEntity {Value = "Bohuslava", NameDay = "7. január", Description = "Ženské meno Bohuslava má slovanský pôvod a jeho význam znamená \"Bohu sláva\". Osobným číslom tohto mena je 9 – Génius. Ich obľúbené farby sú svetlozelená, oranžová a modrá, ochranná rastlina je ľalia a ochranné kamene achát a karneol. Bohuslavy sú elegantné a nežné ženy, aj keď to tak niekedy nevyzerá. Nedávajú najavo svoje slabé stránky, radšej pôsobia ako nezraniteľné a tvrdé ženy. Rady snívajú o svojom živote. Sú to mocné ženy a nikdy nepotrebujú pomoc od druhých. Chcú si všetko urobiť samé a nespoliehajú sa na niekoho iného. Na Bohuslavy by sa nemalo tlačiť, potrebujú určitý čas, aby sa do situácie dostali. Majú rady úprimných ľudí a vyhýbajú sa spoločnosti plnej klamstiev a pretvárok. Sú občas pomalé a menej flexibilnejšie a preto by mali zrýchliť tempo aj v oblasti zamestania. Ak sa im to podarí, majú zaručený úspech. V štúdiu sú Bohuslavy nestále. Majú obľúbené dejiny, ale exaktným vedám sa vyhýbajú. Toto meno je vhodné pre znamenia Barana, Strelca, Škorpióna a Vodnára."},
                new NameEntity {Value = "Božena", NameDay = "27. júl", Description = "Ženské meno Božena má český pôvod a pri prihliadnutí na grécku podobu Theodora je význam tohto mena \"Boží dar, Bohom obdarená\". Ovplyvňuje ich planéta Urán a Saturn. Medzi obľúbené farby patrí zelená a čierna, ochranné rastliny sú baza a medovka, kamene perla a ametyst. Jej osobným číslom je 5 - Riziko. Toto meno sa hodí znameniam: Strelec, Blíženci, Ryby a Vodnár. Ženy nosiace toto meno majú síce komplikovanú povahu, sú zahľadené príliš do seba. Vyznačujú sa tiež dobrými riadiacimi schopnosťami a príjemným vystupovaním. Boženy patria medzi vášnivé ženy, ktoré sú zahalené rozličnými tajomstvami. V spoločnosti sú obratné hostiteľky s vyberaným spoločenským správaním."},
                new NameEntity {Value = "Božidara", NameDay = "1. august", Description = "Ženské meno Božidara má slovanský pôvod a význam mena je \"Boží dar\", \"Bohom daná\". Má odpor ku všetkému negatívnemu a smutnému. Vie sa tešiť z mála a je rodená optimistka. Ak má dostatok peňazí, tak dokáže vyčariť pre svojich blízkych skutočne rajskú záhradu. Hľadá v každom len to dobré a nikdy sa nevzdáva, aj keď ju občas stretne nejaká tragédia. Neberie si nič priveľmi k srdcu. Snaží sa nájsť aj v zlom niečo dobré. Nakoniec sa naozaj dočká úspechu, ocenenia a pochopenia. Precíti bolesti iných, nezveličuje problémy, ktoré jej osud stavia do cesty. Pre ňu neexistuje neprekonateľná prekážka. Vie, že všetko sa dá riešiť a nedá jej, aby aj iných o tom nepresviedčala. Ovplyvňuje ju planéta Merkúr. Ich šťastné farby sú červená a biela. Jej ochranné kamene sú tigrie oko a topás."},
                new NameEntity {Value = "Branislava", NameDay = "14. december", Description = "Ženské mená Branislava a Bronislava majú slovanský pôvod a ich význam je \"bráň slávu\". Sú plné tajomstiev a vzájomne si odporujúcich činov, či sľubov. Sú veľmi nestále a plné pochybností. Nikdy nevedia, čo by mali robiť skôr a čomu by sa mali vyhýbať. O svojej budúcnosti majú dosť reálnu predstavu a aj sa snažia postupovať krok za krokom za svojimi cieľmi. Často menia svoje priority a nedokážu sa celkom odpútať od svojich minulých \"hriechov\". Spolužitie s takýmito ženami nie je síce ľahké, ale veľmi pestré a plné nádherných prekvapení. Ovplyvňuje ich planéta Mesiac. Ich ochranné kamene sú avanturín, rubín a achát."},
                new NameEntity {Value = "Brigita", NameDay = "8. október", Description = "Ženské meno Brigita má keltský pôvod a v preklade znamená \"mocná, silná\". Má nadanie a veľa talentu, vie sa presadiť a bojovať za vlastné názory. Nikto ju nemôže presvedčiť bez dôkazov a logického uvažovania. Veľmi ťažko dokáže uveriť vo vyššie sily. Má rada vo všetkom poriadok a prehľad. Je odvážna a bojovná, málokto odolá jej argumentom. No pretože je úprimná, používa vždy otvorený boj. To nevyhovuje každému v jej okolí, teda sa často stáva obeťou intríg a klebiet. Najlepšie sa jej spolupracuje s mužmi, s nimi vie jednať na rovinu a bez zaváhania sa dokáže dostať na vyššie posty. Je vynikajúca matka. Nezatvára oči pred problémami a vie pochopiť skoro všetky ľudské hriechy. Ovplyvňuje ju planéta Venuša. Jej ochranné kamene sú opál, koral a achát."},
                new NameEntity {Value = "Bronislava", NameDay = "14. december", Description = "Ženské mená Branislava a Bronislava majú slovanský pôvod a ich význam je \"bráň slávu\". Sú plné tajomstiev a vzájomne si odporujúcich činov, či sľubov. Sú veľmi nestále a plné pochybností. Nikdy nevedia, čo by mali robiť skôr a čomu by sa mali vyhýbať. O svojej budúcnosti majú dosť reálnu predstavu a aj sa snažia postupovať krok za krokom za svojimi cieľmi. Často menia svoje priority a nedokážu sa celkom odpútať od svojich minulých \"hriechov\". Spolužitie s takýmito ženami nie je síce ľahké, ale veľmi pestré a plné nádherných prekvapení. Ovplyvňuje ich planéta Mesiac. Ich ochranné kamene sú avanturín, rubín a achát."},
                new NameEntity {Value = "Cecília", NameDay = "22. november", Description = "Ženské meno Cecília má latinský pôvod a v preklade znamená \"krátkozraká, slepá\". Potrebuje mať pocit istoty a preto stále niečo zháňa, dokupuje, mení, kým dosiahne svoj cieľ. Vie, čo chce a ako to dosiahnuť, ale je lenivá a ťažkopádna, preto sa nevie rozhýbať a konať tak, aby sa mala lepšie. Je vášnivá milenka a aj keď nie vždy verná, predsa len stavia rodinu na prvé miesto. Ostatní ju budú zneužívať a využívať, či už pôjde o city, alebo o kariéru. Ovplyvňuje ju planéta Jupiter. Jej ochranné kamene sú ametyst a smaragd."},
                new NameEntity {Value = "Dagmara", NameDay = "20. december", Description = "Ženské meno Dagmara má škandinávsky pôvod a v preklade znamená \"slávny deň\". Všetci ju nakoniec zaradia medzi beznádejné prípady a odvrátia sa od nej. Priťahuje veľa problémov, úskalí a prekážok, ktoré v spojení so ženskou dušou vytvoria rozháranú osobnosť. Potrebuje pomoc a podporu iných. Ak ju volajú Dáša, Dada, alebo Dagmar, potom sa všetko zlepší a jej budúcnosť je v oveľa ružovejšia. Problémy sa vyskytnú, ale nie také vážne, alebo neriešiteľné. V láske bude mať viac šťastia, ani nehovoriac o pracovných výsledkoch. Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú nefrit a jaspis."},
                new NameEntity {Value = "Dana", NameDay = "16. apríl", Description = "Ženské meno Dana má rovnako ako meno Daniela hebrejský pôvod a v preklade znie \"Boh je sudca\". Dany majú priradené osobné číslo 8 – Peniaze a to charakterizuje ich bojovnosť do práce, ale jasne, že až po ich povinnostiach doma. Dany sú nevtieravé typy žien. Dokážu byť dosť uzavreté do seba, čím sa vlastne vzdiaľujú ostatným. Tieto ženy sa radšej učia na chybách druhých ako na svojich. Pôsobia celkom ako zvedavé osoby, ktoré vždy všetko musia vedieť, zisťovať a kontrolovať. No v skutočnosti to tak nemusí byť, ony si iba potrebujú mať všetko jasné. Považujú sa za múdre, ale ako priateľky vás určite nezradia, takže im môžete v pokoji dôverovať. Ich zdravie je celkom v poriadku a chorobám dobre vzdorujú. Mali by jesť každý deň teplé jedlo a piť čerstvé ovocné šťavy. Toto meno je vhodné pre znamenia : Vodnár, ryby, Váhy a Panna. Vhodnou farbou, ktorá podporuje dobré prúdenie ich vnútornej energie je fialová. Obľúbené farby týchto žien sú tmavomodrá a zelená, ochranná rastlina medovka, ochranné kamene ametyst a achát."},
                new NameEntity {Value = "Daniela", NameDay = "3. január", Description = "Ženské meno Daniela má hebrejský pôvod, preložiť sa dá ako \"boh je môj sudca\". Osobným číslom tohto mena je 1 - Vodca. Obľúbená farba Daniely je modrá, ochranná rastlina medovka a ochranný kameň ametyst. Ženy s menom Daniela sú veľmi premenlivé typy. Dokážu sa zmeniť veľmi rýchlo. Jeden deň sa prejavujú ako nežné, utiahnuté, zdržanlivé žienky, ale pri ďalšom stretnutí môžu prekvapiť svojou rozhodnosťou a kritickosťou v snahe zviditeľniť sa. Pri hľadní seba samej sa častokrát uzatvárajú samy do seba.  Ide o racionálny typ žien, preto sa veľmi páčia mužom. Idú si za svojim cieľom, väčšinou, pokiaľ je to možné, čo najkratšou cestou. Potrebujú zmenu, nejakú aktívnu činnosť, aby sa cítili spokojné a vyrované. Sú to ženy plné energie a elánu, rady odpočívajú aktívne – športovo, najradšej majú plávanie. Ich životaschopnosť ich chráni pred chorobami. Toto meno je vhodné pre znamenia Panny,Raka, Býka, alebo Kozorožca."},
                new NameEntity {Value = "Darina", NameDay = "12. august", Description = "Ženské meno Darina je juhoslovanského pôvodu, a v preklade znamená \"dar, darček\". Mala by sa venovať štúdiu cudzích rečí, pretože z jej mena vyžaruje energia, ktorá priťahuje cesty, na ďaleké, aj blízke miesta. Nedokáže dlho zostať na jednom mieste. V práci sa snaží meniť všetko, čo sa len dá. Vždy si nájde niečo, čo by sa malo robiť inak. Kým si neuvedomí, čo jej chýba, bude nešťastná a plná otázok. Musí cestovať, stretávať sa s novými ľuďmi, komunikovať a vždy mať možnosť odísť, ak príde čas. Väčšinou ju vychovávajú staromódne zmýšľajúci rodičia, ktorí jej vštepia dva základné ciele - založiť si rodinu, mať deti a pracovať na zabezpečení ich potrieb. Sama seba brzdí vo svojich vnútorných túžbach a býva nešťastná, pretože bojuje proti vlastnej podstate. Mala by mať voľnosť, slobodu a mali by sme tolerovať aj jej ľahkomyseľnosť. Ovplyvňuje ju planéta Venuša. Jej ochranné kamene sú achát a zafír."},
                new NameEntity {Value = "Daša", NameDay = "10. január", Description = "Krstné meno Dáša má škandinávsky pôvod a v preklade znamená \"slávny deň\". Osobným číslom tohto mena je 6 – Nežnosť. Ich obľúbená farba je tmavozelená, ružová, ochranná rastlina myší chvost, ochranný kameň achát. Tieto ženy bývajú dosť odvážne. Sú citlivé a nežné, ktoré túžia po láske. Dášky rýchlo dospievajú a ich mladosť nič nerobenia rýchlo prejde. Nenávidia realitu, radšej by žili vo svete plnom lásky a dôvery. Vždy povedia, čo si myslia a ich odvaha býva často klamlivá. Ak ich niečo sklame alebo majú ťažkosti, tak sa nedokážu dobre uplatniť a brzdí ich to v živote. Ale ak ich budú blízky podporovať a ochraňovať, bude úspešná. Majú pevnú vôľu a idú si vždy za svojim cieľom. Ak sa o ne budeme precízne starať a budeme im oporou, bezvýhradne nám to oplatia a môžeme sa na ne spoľahnúť. V štúdiu sú ambiciózne, lebo vyhľadávajú nové znalosti. V práci sú veľmi usilovné, môžu byť z nich obchodníčky, či majiteľky reštaurácie, veď je pre ne typické vládnuť pevnou rukou. Ich zdravie je zvyčajne dobré, majú veľa životnej energie. Neprospeje im ponocovanie a sú náchylné na prechladnutie. Vhodné je pre znamenia Vodnára, Rýb, Škorpióna a Strelca."},
                new NameEntity {Value = "Denisa", NameDay = "1. november", Description = "Krstné mená Denisa, Denis majú grécky pôvod. V preklade znamenajú \"zasvätení bohu vína, úrody a plodnosti Dionýzovi\". V jednom momente dokážu riskovať, strácať, získavať, dávať aj prijímať. Nikdy nikomu nič neodoprú, stačí ak ide o nejakého blízkeho človeka a už premýšľajú o pomoci, aj na vlastný úkor. Nikto im nie je cudzí a aj keď sa sklamú, vedia odpúšťať. V práci nevedia dodržať žiadnu disciplínu, ani nemajú vytrvalosť k boju s prekážkami. Nedokážu sa veľmi angažovať v ničom jednotvárnom, alebo nudnom. Musia mať pocit nebezpečenstva, riskovať a nikdy ich nezaujíma výsledok. Ak im partner dokáže svoju lásku, potom mu budú verne stáť po boku aj dlhé roky. Ovplyvňuje ich planéta Merkúr. Ich ochranné kamene sú jaspis, nefrit a citrín."},
                new NameEntity {Value = "Diana", NameDay = "1. júl", Description = "Ženské meno Diana má latinský pôvod a význam tohto mena je \"božská\". Osobným číslom tohto mena je 3 – Schopnosť. Ovplyvňuje ich planéta Venuša. Ich šťastné farby sú prírodná zelená, biela, žltá a svetlomodrá. Ochranné rastliny nechtík, materina dúška, kamene smaragd, zafír a karneol. Diany sú veľmi priebojnými ženami, málokedy sa vzdávajú. Majú rady svoj štýl života a neznesú keď nemôžu využiť každú svoju voľnú chvíľku. Aj keď Diany sa správajú niekedy nevrlo, vždy sa snažia, aby ľudia okolo nich sa cítili spokojne a sebaisto. Kvôli ťažkostiam sa dokážu trápiť dlhý čas a vedia byť nepríjemné, ak sa s nimi nezhodnete. O svojich problémoch nerady hovoria a svoje pocity nedávajú najavo. Sú to šikovné a silné ženy, ktoré sa vždy vedia vynájsť v rôznych situáciach. Vďaka ich energie sú odolné voči chorobe a únave. Niekedy to vedia preceniť a to kvôli ich nestálosti a úzkosti z budúcnosti. Práve preto je potrebné dať toto meno veselému znameniu, ktoré nebude všetko brať z tej horšej stránky, bude vedieť oceniť dobrý vtip a aj kritiku prijať bez tragických pocitov. Je vhodné pre znamenia Strelec, Vodnár, Lev, Váhy"},
                new NameEntity {Value = "Dobromila", NameDay = "28. október", Description = "Ženské meno Dobromila má slovanský pôvod a význam mena je \"milujúca dobro\". Je veľmi aktívna a rýchlo sa vie zorientovať v akomkoľvek probléme. Dokáže sa obrátiť v správnom čase na správneho človeka. Využíva svoj vrodený šarm a nadanie ovládať iných. Málokedy sa snaží podeliť so svojím úspechom, či peniazmi. Iba ak s tými, ktorí sú jej pokrvne blízko, tým vie pomôcť a podržať ich, ale z povinnosti. Celkovo viac premýšľa a menej sa dá ovplyvniť citmi. Viac menej je osamelá, pretože si nevie nájsť dostatok času na vybudovanie trvalého a hodnotného vzťahu. Na prvom mieste je u nej úspech v práci, až potom sa dokáže venovať svojim citom a túžbam. Ovplyvňujú ju planéty Mars a Pluto. Jej ochranné kamene sú rubín a diamant."},
                new NameEntity {Value = "Dobroslava", NameDay = "11. jún", Description = "Ženské meno Dobroslava má slovanský pôvod a význam mena je \"dobrá, dobrotivá\". Ich osobným číslom je 1 – Vodca. Obľúbené farby týchto žien sú oranžová, modrá, žltá a hnedozelená. Ochranné rastliny čakanka, saturejka, ochranné kamene jaspis a nefrit. Ženy menom Dobroslava sú úprimné a snažia sa vždy pochopiť druhých. Chcú sa vždy presadiť, ale prejavia sa iba vtedy, ak to bude potrebné. O svojich súkromných veciach nehovoria. Ak niekomu pomôžu, budú požadovať nejakú odplatu. Usilujú sa, aby ich život bol správne usporiadaný a aby mali vo veciach jasno. Dobroslavy sú tvrdohlavé, ale žijú rozvážne a pokojne. Keď nedosahujú dobré výsledky, potom sú k druhým bezohľadné. Ak si niečo zaumienia, budú nútiť ľuďom okolo aj nasilu pomocť, čo sa mnohým nemusí páčiť. Ich vitalita je zaujímavá a zdravie nezlomné. Dobroslavy sú opatrné a dokážu svoje životné sily šetriť. Toto meno je vhodné pre znamenie Panna, Býk, Rak, Ryby a Škorpión."},
                new NameEntity {Value = "Dominika", NameDay = "4. august", Description = "Meno Dominika je ženskou podobou mena Dominik. Je nadaná, má sklony k umeleckému presadeniu sa. Vie využívať svoju ženskosť v každej situácii. Aj keď o jej výkonnosti sa dá pochybovať, nie je to s ňou také zlé. Je viac opatrná a postupuje pomalšie, ako jej okolie. Pomáha iným, snaží sa vždy vyjsť svojmu okoliu v ústrety, ale málokedy sa dokáže celkom otvoriť iným ľuďom. Rada je \"bútľavou vŕbou\", no svojim známym nedovolí nazrieť do svojho vnútra. Dlho hľadá toho pravého. Nadväzuje množstvo vzťahov s mužmi, preto nemá dobrú povesť, aj keď to nie je celkom spravodlivé. Len sa snaží nájsť skutočnú lásku. Ovplyvňujú ju planéty Jupiter a Neptún. Jej ochranné kamene sú akvamarín, ametyst a smaragd."},
                new NameEntity {Value = "Dorota", NameDay = "6. február", Description = "Dorota je grécke ženské meno a v preklade znamená \"dar boží\". Osobným číslom tohto mena je 9 – Génius. Obľúbené farby týchto žien sú zlatá, fialová, hnedá a žltá. Ochranné rastliny ľubovník a levanduľa, ochranné kamene jantár a ónyx. Dorota dokáže pre seba vyťažiť z každej situácie a využiť ju naplno. Majú veľkú schopnosť ovládať sa v rôznych okolnostiach. Dorota má obrovskú vôľu a nikdy nemá problém sa postarať o seba a svoju budúcnosť. Je čestná a svojich priateľov nikdy nesklame, ale ak jej dôveru niekto zradí, dokáže sa veľmi pomstiť. Klamstvá a problémy vie vycítiť svojou intuíciou. Doroty sú atraktívne, v každej aktivite sú výborne a cieľavedomé a do všetkého sa púšťajú na plný plyn a nikdy sa nevzdáva bez boja. Idú väčšinou pre iných príkladom a vedia povzbudiť a viesť k úspechu druhých. Už od malička vedia, akú profesiu chcú v živote dosiahnuť. Zameriavajú sa väčšinou na povolanie ošetrovateľky, političky ale aj umelkyne. V zdraví nemávajú ťažkosti, ale občas by sa mali vyhýbať na nepravidelné stravovanie a prepracovanosť. K Dorotám sa hodí znamenie ako Panna, Býk, Kozorožec a Ryby."},
                new NameEntity {Value = "Drahomíra", NameDay = "19. január", Description = "Ženské meno Drahomíra má slovanský pôvod a znamená \"komu je drahý mier\". Osobným číslom tohto mena je 2 – Dobrota. Obľúbené farby týchto žien sú prírodne zelená, fialová, hnedá,ružová a biela, ochranná rastlina nechtík, ochranné kamene ruženín a smaragd. O týchto ženách sa dá povedať, že sú aktívne a výrazné osobnosti. Občas majú slabú odvahu, ale ak sa im začne dariť, dodá im to istotu. Drahomíry sa občas vyhýbajú novým poznatkom, lebo sú lenivé. Ale ak chcú, vedia sa presadiť naplno a využiť každú situáciu a žiadne prekážky im v tom nezabránia. Aj napriek svojej energie majú slabú stránku a to, že sú citlivé na svoj osobný život. Inak sú Drahomíry aj dobrými kamarátkami, vedia povzbudiť druhých. Už odmalička tieto ženy rady študujú, aj keď nie výrazne. Postupne sa vypracujú, lebo vedia, čo chcú dosiahnuť. Majú obľubu v médiach a úspečné sú nielen vďaka svojmu zjavu, ale aj dobrotou a slušným správaním. Zamestanie, ktoré je vhodné pre Drahomíry je také, kde majú kontakt s ľuďmi. Čo sa týka ich zdravia, majú ho celkom v poriadku. Vedia dobre odolať únave a preťaženosti. No mali by sa vystríhať prejedaniu a dávať si pozor na svoju váhu. Spravia dobre, ak sa budú pravidelné pohybovať. Toto meno je vhodné pre znamenia : Rak, Panna, Kozorožec, Škorpión."},
                new NameEntity {Value = "Drahoslava", NameDay = "1. september", Description = "Ženské meno Drahoslava má slovanský pôvod a znamená \"drahá sláva\". Prekypuje citmi a je veľmi aktívna. Neobsedí na jednom mieste a iba ťažko zmení svoje názory. Je egoistka s pevným sebavedomím. Napriek tomu, že je energická, jej reakcie sú premyslené a väčšinou mierne. Drahuška sa rada pohybuje v spoločnosti iných ľudí. Má vzácnu schopnosť prispôsobiť sa každému. Je vitálna a má odolnosť potrebnú na realizáciu rušného života. Rada si pochutná na sladkostiach, takže starosti jej môže spôsobiť nadváha. Ovplyvňuje ju planéta Saturn. Ochranné kamene sú zafír, achát a opál."},
                new NameEntity {Value = "Dušana", NameDay = "19. júl", Description = "Ženské meno Dušana má južnoslovanský pôvod a jeho význam je \"slávny duchom\". Ovplyvňujú ich planéty Saturn a Urán. Šťastné farby sú čierna, tmavomodrá a zelená. Ochranné rastliny medovka, baza a divozel, ochranné kamene ametyst a smaragd. Tieto ženy majú neuveriteľnú energiu, ktorá ich ženie dopredu. Obľubujú štúdium, a preto si vedia rýchlo vybrať budúce povolanie. V živote sú šťastné, ale na svoj úspech používajú intrigy a svoj neodolateľný šarm. Sú príjemnými spoločníčkami, a tak ich často pozývajú na spoločenské akcie. V priateľstve dávajú ľudom pocit bezpečia a dôvery. V oblasti zdravia sú odolné."},
                new NameEntity {Value = "Edita", NameDay = "26. september", Description = "Ženské meno Edita má anglický pôvod a v preklade znamená \"bohatá, šťastná\". Je typom človeka, ktorý vie, ako manipulovať so svojím okolím. Vždy má na to, čo robí nejaké ospravedlnenie a sleduje aj prospech iných. Vie byť veľmi tvrdá voči sebe a nevie sa uspokojiť s priemernosťou. Ak vyrastá v rodine, ktorá ju nechápe, rýchlo sa osamostatní. Nie je teda typickou ženou, ktorá potrebuje pozornosť a podporu - ona sama sa dokáže presadiť a aj uspieť. Ak stratí motiváciu, môže na nejaký čas upadnúť do letargie, ale jej životná energia a schopnosť regenerácie ju raz dva dostanú zase do formy. Potrebuje lásku a úprimnosť, ale nevyžaduje stále pripomínanie a prejavovanie citov. Veľa dáva, no aj požaduje, je vždy za rovnocenné jednanie a priamy rozhovor. Ovplyvňuje ju planéta Venuša. Jej ochranné kamene sú achát a opál."},
                new NameEntity {Value = "Ela", NameDay = "24. máj", Description = "Ženské meno Ela je odvodené od mena Helena, ktoré má grécky pôvod a jeho význam je \"svetlo\". Ovplyvňuje ich planéta Venuša. Ich šťastné farby sú žltá, zelená, biela. Ochranné rastliny prvosienka, rebarbora, ochranný kameň citrín. Osobným číslom pre toto meno je 8 - Peniaze. Nositeľky tohto mena sú veľmi pôvabné a citlivé ženy, ktoré to vedia aj zneužiť. Nerady sa prispôsobujú druhým a všetko sa musí robiť podľa ich predstáv. Ak sa tak nestane, uzavrú sa a s nikým nekomunikujú. Majú rady všetko pekné a farebné. Vôbec nie sú šetrné. Všetky peniaze, ktoré zarobia ihneď minú na veci, ktoré sa im páčia. K ich záľube patrí, keď môžu niečo plánovať a meniť veci podľa ich predstáv. Málokedy sú spokojné, nevedia obstáť na jednom mieste a to sa týka aj ich zamestnania, ale ak túžia po niečom, snažia sa to docieliť. Prekážky v ich záležitostiach im vôbec nevadia, práve naopak. Vyhľadávajú náročnejšie úlohy a to preto, aby ukázali ostatným, že sú to silné ženy. Ely majú výbornú životaschopnosť. Vedia dobre odolávať rôznym ťažkostiam a hlavne fyzicky ale aj psychicky. Aby si udržiavali svoje zdravie, mali by jedávať pravidelne a najmä bez náhlenia. Toto meno je vhodné pre znamenia : Váhy, Škorpión, Strelec, Lev a Baran."},
                new NameEntity {Value = "Elena", NameDay = "18. august", Description = "Ženské meno Elena je odvodené od mena Helena. Meno Helena má grécky pôvod a v preklade znamená \"svetlo\". Osobným číslom tohto mena je 9 – Génius. Ovplyvňuje ich planéta Merkúr. Ich šťastné farby sú červená, žltá, modrá a biela. Ochranné rastliny podbeľ, rasca, ochranné kamene tigrie oko, topás a achát. Eleny si žijú život po svojom, v ktorom rady snívajú. Sú to pôvabné a citlivé ženy, ktoré sú v spoločnosti obľúbené. Tieto ženy sú silné a príjemné, ktoré majú rady zmeny vo svojom živote. Vždy sa snažia pochopiť druhých a vždy si vedia nájsť správnu cestu k úspechu. Ak chcú dosiahnuť svoje ciele, vedia bojovať v každej situácií. Vedia naplno využiť svoju predtuchu a city, ktoré im pomôžu vždy získať úspech. Toto meno je vhodné pre akékoľvek znamenie."},
                new NameEntity {Value = "Eleonóra", NameDay = "21. február", Description = "Eleonóra je španielske ženské meno asi z arabského Elinnor, čo znamená \"boh je moje svetlo\". Osobné číslo pre toto meno je 3 – Schopnosť. Ich obľúbené farby sú sivá, zelená, oranžová, čierna a modrá. Ochranné rastliny medovka, koriander, mak a krokus. Ochranné kamene achát, zirkón a jaspis. Tieto ženy sú otvorené k spoločenskému životu. Sú pôvabné a majú vo veciach prehľad, vedia sa presadiť aj napr. v mužských veciach a ukazujú smer aj ľuďom, ktorí sú slabšími. Nie sú stabilné a prudko sa u nich menia ich nálady a náklonnosti. Eleonóry prinášajú v živote šťastie a dobrú spoločnosť. Avšak sú detajlistky, nedokážu niekomu odpustiť ani maličký prešľap, snažia sa robiť veci bezchybne. Mali by jesť mliečne výrobky a všetky potraviny, ktoré obsahujú vitamíny C a E. Často trpia na žlčníkové problémy, alebo vredy, pretože sa trápia kvôli nedokonalosti sveta okolo. Toto meno je v súlade so znameniami Vodnára, Strelca, Leva, Barana a Blížencov."},
                new NameEntity {Value = "Eliška", NameDay = "7. október", Description = "Ženské meno Eliška má hebrejský pôvod. Je variantom novozákonného biblického mena Alžbeta, čo v preklade znamená \"Bohu zasvätená\". Je predurčená k úspechu, má šťastnú ruku a vždy dosiahne to, čo potrebuje pre svoju spokojnosť. Je vyvolenou osudu. Nikdy nie je osamelá, stále vie, čo má urobiť a ako postupovať. Okolo nej je vždy veľa príživníkov a pätolízačov. Vždy vie, kto to s ňou myslí úprimne a lichôtkam nevenuje veľa pozornosti. Je panovačná, priama, rýchla, bystrá a veľmi ženská. Využíva všetko, čo sa len dá, aby zdôraznila samú seba. Má o sebe vysokú mienku - je však pravdivá. Nemusí sa podceňovať. Ak bude uvažovať reálne, tak nikdy neskončí vzadu, ani bez ocenenia. Ovplyvňujú ju planéty Saturn a Urán. Jej ochranné kamene sú ametyst, achát a perla."},
                new NameEntity {Value = "Elvíra", NameDay = "21. november", Description = "Ženské meno Elvíra má španielsky pôvod a v preklade znamená \"vznešená\", \"kňažná\". Je dobrá duša, ktorá vždy myslí najprv na iných, až potom na seba. Nechá sa využívať a až po dlhej dobe zistí, čo a ako. Vydáva sa v neskoršom veku, až keď už pomohla všetkým okolo k šťastiu. Sama si nevie vysvetliť, prečo koná tak a ani po dlhých rokoch nevie odolať konaniu dobra a pomoci iným. Má neodolateľné snahy v každej situácii uprednostňovať záujmy iných pred svojimi vlastnými. Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú jaspis a zafír."},
                new NameEntity {Value = "Ema", NameDay = "30. január", Description = "Ženské meno Ema má nemecký pôvod a v preklade znamená \"veľká\", \"silná\". Osobným číslom tohto mena je 1 - Vodca. Ich obľúbené farby sú zelená, červená, biela a modrá, ochranné rastliny medovka a baza, ochranné kamene smaragd, tyrkys, rastlinným totemom je upokojujúca a utišujúca lipa. Ženy tohto mena sú veľmi citlivé, ale nikdy sa nedostane s niekým do rozporu. Emy bývajú vnímavé a obozretné, rady pomôžu druhým, keď to potrebujú, bez toho, aby hľadeli na seba. Tieto ženy sú ochotné pre svoju kariétu urobiť všetko. Nikdy sa vopred nezdajú. Najprv sa chcú zabezpečiť a uplatniť sa v práci a až potom si zaobstarajú rodinu. Vo všetkom, do čoho sa pustia, sú zodpovedné a presné. Emy majú zdravie uspokojivé, ale môžu ich trápiť ťažkosti spojené s nervovým systémom. Toto meno je vhodné pre znamenia : Kozorožec, Panna, Býk, Ryby."},
                new NameEntity {Value = "Emília", NameDay = "24. november", Description = "Ženské meno Emília má latinský pôvod a v preklade znamená \"horlivá, usilovná\". Je pre ňu veľmi dôležitá harmónia a spokojnosť jej blízkych. Rodina a priatelia sú pre ňu potrební, ich názory vždy prijíma s pozornosťou a snaží sa meniť, ak si uzná svoju chybu. No k cudzím, či menej dôležitým ľuďom býva odmietavá a málokedy si nechá poradiť. V práci teda nebude ľahké s ňou vychádzať, lepšie by bolo, ak by bola sama sebe šéfom. V láske však býva rada v područí silnejšieho pohlavia. Ovplyvňujú ju planéty Mars a Pluto. Jej ochranné kamene sú rubín a diamant."},
                new NameEntity {Value = "Erika", NameDay = "2. február", Description = "Ženské meno Erika má osobné číslo 8 – Peniaze. Vhodnou farbou je čierna, zelená a červená a ich ochrannými rastlinami je medovka a baza, kamene ametyst a jaspis. Eriky chcú žiť v rozjarenosti bezstarostného života a hlavne vždy hľadajú cestu ako sa vyhnúť zodpovednosti. Pôsobí nevinne, sú dosť uzavreté, bezstarostné, nezneužíva svoje postavenie, práve naopak, dokáže sa prispôsobiť iným situáciam a názorom ľudí v jej okolí. A však vo vnútri uvažuje ako si naplánuje na dlhší čas veci a svoje okolie postupne ovládne. Nemajú dostatok sebadôvery a často ich ľudia rýchlo ovplyvnia. Eriky chcú byť veľmi milované, aby sa cítili bezpečnejšie. Šťastná však bude len málokedy, lebo stále čaká ohrozenie z rôznych situácií. Ale ich falošná bezohľadnosť, prefíkanosť a neústupčivosť od nich dokáže rýchlo odlákať mužov. Toto meno je vhodné pre znamenia Rýb, Váh, Panny a Kozorožca."},
                new NameEntity {Value = "Estera", NameDay = "12. apríl", Description = "Ženské meno Estera je starozákonné, má hebrejský pôvod a význam mena je \"hviezda\". Osobným číslom tohto mena je 5 - Riziko. Aj keď sú Estery dosť aktívne, ich slabosťou je introvertnosť a hanblivosť. Toto meno Esteram neprináša veľa šťastia, musia sa dosť presadiť, aby dosiahli úspech, čo im nemusí vždy vyhovovať. Nepresadzujú veľmi svoju silu a majú radšej keď nie sú v popredí a môžu sa zaujímať o svoju rodinu. Tieto uzavreté ženy nerady trávia svoj čas v spoločnosti. Potrebujú, aby im ľudia rozumeli a nezradili. Estery sú dosť náročné – chceli by mať vždy všetko pohromade. Toto meno je vhodné pre znamenia : Váhy, Panna, Strelec, Baran, Lev, Býk a ich šťastné farby sú biela, zelená a bledomodrá. Ochranné rastliny: myší chvost, fialka a mäta, ochranné kamene achát a zafír."},
                new NameEntity {Value = "Etela", NameDay = "22. február", Description = "Ženské meno Etela má anglický pôvod a jeho význam je \"vznešená\". Obľúbené farby týchto žien sú tmavomodrá, červená a ružová. Ochranné rastliny puškvorec, cesnak a nezábudka. Ochranné kamene rubín, diamant a jaspis. Jej číslom je 8 –Peniaze. Etela nemá problém s peniazmi, vždy si nájde cestu k ním. Má správny postoj k životu a nie je lakomá. Keď vyrastie, pôsobí múdro ale väčšinou uzavreto. Etela dokáže byť dosť konfliktná a hádka s ňou nemusí dopadnúť pozitívne. Dokáže rýchlo reagovať, všetko ma odsledované a nič jej nemôže ujsť. V citovom živote potrebuje lásku od muža, podporu a hlavne stálosť. Etela je rodinne založená vo všetkých oblastiach, sú starostlivé a verné. Mali by si dať pozor na jedenie sladkých a mastných jedál. Vhodným znamením je Škorpión, Býk a Váhy."},
                new NameEntity {Value = "Eugénia", NameDay = "18. september", Description = "Toto meno je gréckeho pôvodu a v preklade znamená \"urodzená\". Pre ženu nie je dobré, pretože v nej podporuje rozpoltenosť a neistotu. Nedá sa od nej čakať, aby umývala riad, utierala deťom zadočky či štopkala manželove ponožky. Buď to budete robiť za ňu, alebo vás znenávidí a bude vás obviňovať z necitlivosti. Je to rodená a beznádejná romantička, ktorá sníva s otvorenými očami a len veľmi nerada sa prebúdza do reality. Pracuje, ale nie veľmi nadšene a vyhýba sa akejkoľvek zodpovednosti. Keby sa narodila v minulosti, určite by bola skvelou princeznou, ktorá by nerobila nič iné, iba snívala v zamurovanej veži o prinocvi na bielom koni. V terajšom svete má iba jedno riešenie - vydať sa a to veľmi dobre, do luxusu a blahobytu. Kvôli tomu je ochotná urobiť všetko a tak aspoň v tomto sa prejaví ich genialita. Ovplyvňuje ju planéta Mars. Jej ochranné kamene sú diamant a jaspis."},
                new NameEntity {Value = "Eva", NameDay = "24. december", Description = "Pôvod mena Eva pochádza z hebrejčiny a vo voľnom preklade znamená \"tá, ktorá dáva život\". Je vždy na dôležitom mieste, snaží sa pracovať a konať tak, aby boli všetci s ňou spokojní. Niekedy je až príliš zodpovedná. Má výrazný zmysel pre humor. Je nadaná a skvelá osobnosť, má aj sklony k umeleckej činnosti a nikdy nekoná bez premýšľania. Jej fantázia je dobre rozvinutá. Dokáže sa prispôsobovať potrebám a názorom iných. Nikdy nie je tvrdohlavá, alebo neústupčivá. Ako matka a manželka je výborná, no ak ju stretnete v mladom veku, často má na svojej povesti rôzne \"škvrny\". Ovplyvňuje ju planéta Merkúr. Jej ochranné kamene sú sardónyx a zafír."},
                new NameEntity {Value = "Filoména", NameDay = "27. december", Description = "Ženské meno Filoména má grécky pôvod a v preklade znamená \"milovaná\". Nemá problémy s peniazmi, ak nedá na rady iných. Ak si sama verí a počúva svoje vnútorné \"ciťáky\", potom uspeje aj bez pomoci. Stačí, ak len trochu nechá svoj názor ovplyvniť niekým iným a už sa jej úspech vyhne. V láske je praktická, vždy si dá pozor na to, aby na prvom mieste bol rozum a nie cit. Snaží sa vždy nájsť si pre seba vhodného partnera, takého, čo by šetril a snažil sa čím menej utrácať. Napriek tomu nie je skúpa. Ona len vždy potrebuje určitú rezervu na to, aby mohla pokojne spávať. Jej ochranné kamene sú ametyst a chalcedón."},
